import React, { Component } from "react";
import "../Styles/TrainerSpace.css";

import { Container, Row, Col } from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";
import { Link } from "react-router-dom";
import backgroundImage from "../assets/background.jpeg";
import Image from "react-bootstrap/Image";

export default class TrainerSpace extends Component {
  render() {
    return (
      <div class="body">
        <Container>
          <p class="clientSpace">ESPACE CLIENT</p>
        </Container>
        <Container>
          <Row>
            <Col sm={6}>
              <div class="loginDiv">
                <p class="already">DÉJÀ CLIENT ?</p>
                <p class="above">ADRESSE EMAIL *</p>
                <input class="inputAccount" placeholder="Renseignez votre email" />
                <p class="above">MOT DE PASSE *</p>
                <input class="inputAccount" placeholder="Saisissez votre mot de passe" />
                <p class="passForg" >Mot de passe oublié ?</p>
                <a href="###" onClick={() => Alert("asdsf")}>
                  <div class="logIn" >M'IDENTIFIER</div></a>
              </div>
            </Col>
            <Col sm={6}>
              <div class="loginDiv" >
                <p class="already">NOUVEAU CLIENT</p>
                <a href="###" onClick={() => Alert("asdsf")}>
                  <div class="logIn" >CRÉER UN COMPTE</div></a>
              </div>
            </Col>
          </Row>

        </Container>
      </div>
    );
  }
}
